import React from 'react'
import { useTodoContext } from '../context/TodoListContext'

const TodoList = () =>{
  const{todoList} = useTodoContext();

  return(
    <ul>
      {todoList.map((todo,index)=>(
      <li key={index}>{todo}</li>
      ))}
    </ul>
  )
}

export default Todolist;
